import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import ServiceData from "./ServicesData";
import CustomCard from "./CustomCard";
import Grid from "@mui/material/Grid";

const SimpleSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    slidesToShow:3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
    pauseOnHover: true,
    variableWidth: true, 

    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
        }
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
        }
      }
    ]
  };

  return (
    <>
      <Slider {...settings}>
        {ServiceData.map((val, id) => (
          <Grid item xs={11} sm={11} md={11} key={id}>
            <CustomCard
              image={val.image}
              title={val.title}
              rating={val.rating}
              price={val.price}
            />
          </Grid>
        ))}
      </Slider>
    </>
  );
};

export default SimpleSlider;
